import React from 'react';
import './App.css';

function App() {

  const handleTestClick = () => {
    alert('Button is working!');
  };

  return (
    <div className="App">
      <header className="App-header">
        <h1>Debugging Step</h1>
      </header>
      <main>
        <section>
          <h2>Test Button</h2>
          <p>Please click the button below. An alert box should appear if it is working.</p>
          <button onClick={handleTestClick}>Test Me</button>
        </section>
      </main>
    </div>
  );
}

export default App;
